import React from 'react';

const Menu = () => {
    const menuItems = [
        { id: 1, name: 'Pasta Carbonara', description: 'Creamy pasta with bacon and Parmesan cheese', price: '₹999' },
        { id: 2, name: 'Margherita Pizza', description: 'Classic pizza with tomato sauce, mozzarella, and basil', price: '₹799' },
        { id: 3, name: 'Grilled Salmon', description: 'Grilled salmon fillet served with seasonal vegetables', price: '₹1199' },
        { id: 4, name: 'Tiramisu', description: 'Classic Italian dessert with layers of coffee-soaked ladyfingers and mascarpone cream', price: '₹499' },
        { id: 5, name: 'Chicken Alfredo', description: 'Fettuccine pasta with creamy Alfredo sauce and grilled chicken', price: '₹1299' },
        { id: 6, name: 'Caprese Salad', description: 'Fresh mozzarella, tomatoes, and basil drizzled with balsamic glaze', price: '₹699' },
        { id: 7, name: 'Filet Mignon', description: 'Tender filet mignon steak cooked to your preference', price: '₹1599' },
        { id: 8, name: 'Lemon Tart', description: 'Zesty lemon custard in a buttery tart shell, topped with powdered sugar', price: '₹599' },
        { id: 9, name: 'Vegetarian Lasagna', description: 'Layers of pasta, ricotta cheese, spinach, and marinara sauce', price: '₹1099' },
        { id: 10, name: 'Chocolate Lava Cake', description: 'Warm chocolate cake with a molten chocolate center, served with vanilla ice cream', price: '₹799' },
      ];      

  return (
    <div className="menu">
      <h2>Menu</h2>
      <div className="menu-items">
        {menuItems.map(item => (
          <div key={item.id} className="menu-item">
            <h3>{item.name}</h3>
            <p>{item.description}</p>
            <p className="price">{item.price}</p>
          </div>
        ))}
      </div>
    </div>
  );
};

export default Menu;
